    void Start()
    {
        klon = Instantiate(kelime, kelimeBaslangic.position, kelime.transform.rotation);


        for (int i = 7; i >= 0; i--)
        {
            for (int j = 0; j < 8; j++)
            {
                harfdeposu[i, j] = '0';
            }
        }
    }

    IEnumerator gonderTusu()
    {
        Time.timeScale = 0;
        kelimeBul();
        yield return new WaitForSecondsRealtime(1);
        Time.timeScale = 1;
    }
    public void KelimeOlustur()
    {
        klon = Instantiate(kelime, kelimeBaslangic.position, kelime.transform.rotation);
    }

    public void gondereBas()
    {
        StartCoroutine(gonderTusu());
    }

    void kelimeBul()
    {
        for (int i = 7; i >= 0; i--)
        {     
            for (int k = 7; k > 3; k--)
            {
                for (int j = 0; j < k; j++)
                {
                    if(olusturulanKelime!=null)
                    {
                        if (harfdeposu[i, j] == '0')
                        {
                            olusturulanKelime = null;
                            for (int m = 0; m < 64; m++)
                                yokEdilecekler[m] = null; 
                            harfSayisi = 0;
                        }
                    }
                    if (harfdeposu[i, j] != '0')
                    {
                        olusturulanKelime += harfdeposu[i, j];
                        yokEdilecekler[harfSayisi] = kutular[i, j];
                        harfSayisi++;
                    }
                }
                if (harfSayisi > 3)
                    listedenBul();
                harfSayisi = 0;
            }
        }
    }

    void listedenBul()
    {
        if(harfSayisi == 4)
        {
            foreach (string kelime in kelimeDort)
            {
                if(olusturulanKelime==kelime)
                {
                    kelimeYokEt();
                    break;
                }
            }
                
        }
        if (harfSayisi == 5)
        {
            foreach (string kelime in kelimeBes)
            {
                if (olusturulanKelime == kelime)
                {
                    kelimeYokEt();
                    break;
                }
            }

        }
        if (harfSayisi == 6)
        {
            foreach (string kelime in kelimeAlti)
            {
                if (olusturulanKelime == kelime)
                {
                    kelimeYokEt();
                    break;
                }
            }

        }
        if (harfSayisi == 7)
        {
            foreach (string kelime in kelimeYedi)
            {
                if (olusturulanKelime == kelime)
                {
                    kelimeYokEt();
                    break;
                }
            }

        }
        if (harfSayisi == 8)
        {
            foreach (string kelime in kelimeSekiz)
            {
                if (olusturulanKelime == kelime)
                {
                    kelimeYokEt();
                    break;
                }
            }

        }
    }
    void kelimeYokEt()
    {
        for (int i = 0; i < yokEdilecekler.Length; i++)
            Destroy(yokEdilecekler[i]);
    }
